import styles from "./HeaderLogin.module.scss";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEllipsisVertical, faQuestionCircle, faA } from '@fortawesome/free-solid-svg-icons'
import LoginButton from "../LoginButton";
import UploadButton from "../UploadButton";
import Menu from "../Menu";
import Tippy from '@tippyjs/react/headless';
import { useState } from "react";

function HeaderLogin({ onclick }) {
  const [menus] = useState({
    hasIcon: "Icon",
    data: [
      {
        text: "English",
        iconSeeMore: <FontAwesomeIcon className={styles["icon"]} icon={faA} />,
        children: [{ language: "English" }],
      },
      { text: "Feedback and help", iconSeeMore: faQuestionCircle },
      { text: "Keyboard shortcuts", iconSeeMore: faQuestionCircle },
    ]
  });

  const _props = {
    onclick,
  };

  return (
    <>
      <UploadButton to="/upload" stylesupload='wrapper'>Upload</UploadButton>
      <LoginButton {..._props}>Login</LoginButton>
      <Tippy
        interactive
        delay={20}
        placement="right-end"
        render={attrs => (
          <div>
            <div className={styles['see-more-popup']} tabIndex="-1" {...attrs}>
              <Menu listMenu={menus} />
            </div>
          </div>
        )}
      >
        <div className={styles['see-more-icon']}>
          <FontAwesomeIcon icon={faEllipsisVertical} />
        </div>
      </Tippy>
    </>
  );
}

export default HeaderLogin;
